B.W8=new A.cb(" se realizar\xe1 siempre y cuando exista disponibilidad de las especies solicitadas. En todo caso, por motivos estrictamente biol\xf3gicos, s\xf3lo podr\xe1n ser utilizadas en \xe1reas rurales, urbanas y periurbanas, y siempre fuera de Espacios Naturales Protegidos.\n\n",null,null,B.M,null)
B.VZ=new A.cb("2. Especies objeto de venta.",null,null,B.M,B.aQ)
B.W2=new A.cb(" Las especies que pueden quedar bajo r\xe9gimen de ventas est\xe1n limitadas por la legislaci\xf3n vigente en materia de Conservaci\xf3n y Protecci\xf3n de Especies. Actualmente, en este Vivero dichas especies se restringen a las que figuran en el anexo I de la presente solicitud.\n\n",null,null,B.M,null)
B.W3=new A.cb("3. Cesiones.",null,null,B.M,B.aQ)
B.VW=new A.cb("  Se considerar\xe1n excluidos del r\xe9gimen de ventas a todos los Centros Educativos de distintos niveles de formaci\xf3n, as\xed como las Asociaciones legalmente constituidas que, sin \xe1nimo de lucro, pretendan ajardinar peque\xf1as parcelas de terreno, a quienes se ceder\xe1n las plantas y semillas de forma gratuita. Asimismo, quedan excluidas del r\xe9gimen de ventas las plantas y semillas necesarias para aquellas acciones ejecutadas directamente por el Excmo. Cabildo Insular de Tenerife o por cualquier otro organismo p\xfablico, siempre y cuando no se trate de una obra adjudicada a un contratista y la provisi\xf3n de las plantas o semillas figure como partida en el presupuesto y corra a cargo del adjudicatario.\n\n",null,null,B.M,null)
B.Wc=new A.cb("4. Cantidades.",null,null,B.M,B.aQ)
B.W7=new A.cb("  Las cantidades cedidas o vendidas estar\xe1n en funci\xf3n de la disponibilidad de planta en vivero y de los criterios ecol\xf3gicos y paisaj\xedsticos de reparto. En los casos que superen los 500 ejemplares al a\xf1o (por acumulaci\xf3n de pedidos o en una \xfanica entrega) se requerir\xe1 la presentaci\xf3n del proyecto de plantaci\xf3n y la emisi\xf3n de informe t\xe9cnico favorable.\n\n",null,null,B.M,null)
B.W5=new A.cb("5. Presentaci\xf3n de solicitudes.",null,null,B.M,B.aQ)
B.Wd=new A.cb("  Se entregar\xe1n preferentemente en el Centro Ambiental \u201cLa Tahonilla\u201d, en la direcci\xf3n que figura en el encabezado, en los Registros de Entrada del \xc1rea de Medio Ambiente, en las sedes de las Oficinas Comarcales del \xc1rea de Medio Ambiente del Cabildo Insular de Tenerife, o en cualquiera de las oficinas descentralizadas del mismo.\n\n",null,null,B.M,null)
B.Wa=new A.cb("6. Plazo de solicitud.",null,null,B.M,B.aQ)
B.W6=new A.cb(" Las solicitudes pueden presentarse a lo largo de todo el a\xf1o, seg\xfan modelo facilitado en cualquiera de las oficinas del apartado anterior. No se realizar\xe1n cesiones entre los meses de mayo y septiembre, ambos incluidos, debido a la baja tasa de arraigo de las plantas durante los meses en los que se combina sequ\xeda con altas temperaturas.\n\n",null,null,B.M,null)
B.W0=new A.cb("7.Casos particulares:\n",null,null,B.M,B.aQ)
B.VV=new A.cb("  7.1.",null,null,B.M,B.aQ)
B.Wi=new A.cb(" Las solicitudes de plantas cuyo destino sea fuera de la isla ser\xe1n estudiadas de forma particular, pudi\xe9ndose denegar como medida de preservaci\xf3n de la biodiversidad, y requerir\xe1n en todo caso autorizaci\xf3n administrativa.\n",null,null,B.M,null)
B.W1=new A.cb("  7.2.",null,null,B.M,B.aQ)
B.We=new A.cb(" Cualquier solicitud que corresponda a alguno de los casos no previstos conllevar\xe1 el dictamen del Servicio T\xe9cnico de Gesti\xf3n Territorial Ambiental, fundamentando la autorizaci\xf3n o denegaci\xf3n de la misma.\n\n",null,null,B.M,null)
