B.W_=new A.cb("\n\nRestauraci\xf3n ecol\xf3gica.",null,null,B.M,B.aQ)
B.VX=new A.cb(" Acci\xf3n que pretende llevar un ecosistema a su estado natural previo a las alteraciones ocurridas, normalmente debidas al hombre.\n\n",null,null,B.M,null)
B.Wk=new A.cb("Recuperaci\xf3n asistida.",null,null,B.M,B.aQ)
B.Wj=new A.cb(" Liberaci\xf3n del ecosistema del estr\xe9s que lo alter\xf3, ayud\xe1ndolo en el proceso de sucesi\xf3n ecol\xf3gica.\n\n",null,null,B.M,null)
